  const [searchInput, setSearchInput] = useState("");

  return (
    <div className="side-bar-search-input-wrapper">
      <input
        placeholder="Search a conversation..."
        className="side-bar-search-input"
        value={searchInput}
      />
    </div>
  );
};

export default SideBarSearchInput;
